PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "justificativas" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "nome" varchar, "cod_justificativa" varchar, "tipo" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "uf" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "nome" varchar, "sigla" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "admin_useres" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "active_admin_comments" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "namespace" varchar, "body" text, "resource_id" varchar NOT NULL, "resource_type" varchar NOT NULL, "author_type" varchar, "author_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "regionais" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "cod_regional" varchar, "nome" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "analistas" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "nome" varchar, "email" varchar, "fone_contato" varchar, "funcao" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "regional_id" integer);
CREATE TABLE IF NOT EXISTS "servicos" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "nome" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "codigo" varchar);
CREATE TABLE IF NOT EXISTS "solicitacoes" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "numero_vt" varchar, "data_solicitacao" date, "solicitante" varchar, "analista" varchar, "servico" varchar, "banda" integer, "endereco_a" varchar, "localidade_a" varchar, "uf_a" varchar, "endereco_b" varchar, "localidade_b" varchar, "uf_b" varchar, "resultado_vt" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "empresa_id" integer);
CREATE TABLE IF NOT EXISTS "respostas" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "tipo" varchar, "estrutura" varchar, "descricao" text, "prazo" integer, "capex" decimal(10,2), "opex_instalacao" decimal(10,2), "opex_mensal" decimal(10,2), "resultado_vt" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "solicitacao_id" integer);
CREATE TABLE IF NOT EXISTS "estacoes" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "pop" varchar, "nome" varchar, "endereco" varchar, "cidade" varchar, "uf" varchar, "tipo" varchar, "cedente" varchar, "latitude" decimal(15,13), "longitude" decimal(15,13), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "status" varchar);
CREATE TABLE IF NOT EXISTS "equipamentos" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "designacao" varchar, "descricao" text, "tipo" varchar, "enderecamento" varchar, "firmware" varchar, "status" varchar, "arco" varchar, "cluster" varchar, "estacao_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "localidades" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "sigla_cnl" varchar, "cod_cnl" varchar, "localidade" varchar, "municipio" varchar, "latitude" decimal(15,13), "longitude" decimal(15,13), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "uf_id" integer);
CREATE TABLE IF NOT EXISTS "analises" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "analise" varchar, "dataStatus" date, "solicitacao_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "admin" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "nome" varchar, "regra" integer);
CREATE TABLE IF NOT EXISTS "usuarios" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "nome" varchar, "regra" integer);
CREATE TABLE IF NOT EXISTS "empresas" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "cnpj" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "nome_fantasia" varchar, "sap" varchar, "razao" varchar, "regional" varchar);
CREATE TABLE IF NOT EXISTS "contatos" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "nome" varchar(50), "sobrenome" varchar(50), "obs" text, "empresa_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "email" varchar);
CREATE TABLE IF NOT EXISTS "telefones" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "telefone" varchar(12), "contato_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "produtos" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "tipo" varchar(15), "fornecedor" varchar(50), "velocidade" integer, "origem" varchar(50), "uf_a" varchar(2), "destino" varchar(50), "uf_b" varchar(2), "obs" text, "empresa_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "enderecos" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "logradouro" varchar(250), "cidade" varchar(50), "uf" varchar(2), "cep" varchar(8), "empresa_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "circuitos" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "designacao" varchar(12), "descricao" varchar(250), "servico" integer, "status" integer, "roteamento" integer, "asn" integer, "bandaContratada" integer, "bandaAtivada" integer, "dataAtivacao" date, "contrato" varchar, "sap" integer, "empresa_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "index_admin_useres_on_email" ON "admin_useres" ("email");
CREATE UNIQUE INDEX "index_admin_useres_on_reset_password_token" ON "admin_useres" ("reset_password_token");
CREATE INDEX "index_active_admin_comments_on_author_type_and_author_id" ON "active_admin_comments" ("author_type", "author_id");
CREATE INDEX "index_active_admin_comments_on_namespace" ON "active_admin_comments" ("namespace");
CREATE INDEX "index_active_admin_comments_on_resource_type_and_resource_id" ON "active_admin_comments" ("resource_type", "resource_id");
CREATE INDEX "index_analistas_on_regional_id" ON "analistas" ("regional_id");
CREATE INDEX "index_solicitacaes_on_empresa_id" ON "solicitacoes" ("empresa_id");
CREATE INDEX "index_respostas_on_solicitacao_id" ON "respostas" ("solicitacao_id");
CREATE INDEX "index_equipamentos_on_estacao_id" ON "equipamentos" ("estacao_id");
CREATE INDEX "index_localidades_on_uf_id" ON "localidades" ("uf_id");
CREATE INDEX "index_analises_on_solicitacao_id" ON "analises" ("solicitacao_id");
CREATE UNIQUE INDEX "index_admin_on_email" ON "admin" ("email");
CREATE UNIQUE INDEX "index_admin_on_reset_password_token" ON "admin" ("reset_password_token");
CREATE UNIQUE INDEX "index_usuarios_on_email" ON "usuarios" ("email");
CREATE UNIQUE INDEX "index_usuarios_on_reset_password_token" ON "usuarios" ("reset_password_token");
CREATE INDEX "index_contatos_on_empresa_id" ON "contatos" ("empresa_id");
CREATE INDEX "index_telefones_on_contato_id" ON "telefones" ("contato_id");
CREATE INDEX "index_produtos_on_empresa_id" ON "produtos" ("empresa_id");
CREATE INDEX "index_enderecos_on_empresa_id" ON "enderecos" ("empresa_id");
CREATE INDEX "index_circuitos_on_empresa_id" ON "circuitos" ("empresa_id");
COMMIT;
